import React, { Component } from 'react';
import { Form, Formik } from 'formik';
import { moment } from 'moment';
import PropTypes from 'prop-types';
import AuthenticationService from '../../services/AuthenticationService.js';
import { withRouter } from 'react-router-dom';
class Insert_home extends Component {

    constructor(props) {

        super(props);
        this.state =

        {
            homeName: '',
            homeUrl: '',
            homePhone: '',
        }

    }

    handleChange = (event) => {

        this.setState({ [event.target.name]: event.target.value });
    }

    checkLogin = () => {


        if (this.state.username === 'teo' && this.state.password === '123') {
            AuthenticationService.login(this.state.username, this.state.password)
            this.props.history.push(`/welcome/${this.state.username}`)
            this.setState({ status: 1 })
        }
        else
            this.setState({ status: 0 })
    }

    render() {
        return (
            <div className="Login container bg-light">
                <Formik>
                    <Form>
                        <div className="form-group">
                            <label htmlFor="homeName">UserName:</label>
                            <input type="text" name="homeName" className="form-control"
                                placeholder="ENTER HOMENAME" aria-describedby="homeName" onChange={this.handleChange} value={this.state.homeName} />
                            <label htmlFor="homeUrl">Password:</label>
                            <input type="text" name="homeUrl" className="form-control" placeholder="EnterUrl"
                                aria-describedby="passhelp" onChange={this.handleChange} value={this.state.homeUrl} />
                            <label htmlFor="homePhone">Password:</label>
                            <input type="text" name="homePhone" className="form-control" placeholder="Enter Phone"
                                aria-describedby="homePhone" onChange={this.handleChange} value={this.state.homePhone} />
                            <br></br>
                            <button className="btn btn-success" onClick={this.checkLogin}>
                                Login
                </button>
                        </div></Form>
                </Formik>
            </div>
        );


    }


}




function ShowLogin(props) {

    if (props.status === 0)
        return (
            <div className="alert alert-danger">
                Login Failed!
            </div>
        )
    else if (props.status === 1)
        return (
            <div className="alert alert-danger">
                Login Succeeded!
            </div>
        )
    else
        return null;


}

ShowLogin.defaultProps = {
    status: -1,

}

ShowLogin.propTypes = {
    status: PropTypes.number
}



export default withRouter(Insert_home);
